import React from 'react';
import Nav from 'react-bootstrap/Nav';


function Header() {
    return (
      <header>
        <h1>URL Shortener</h1>
        <nav>
          <ul>
            <a href="/">Home </a>
            <a href="/user/login"> Login </a>
            <a href="/user/signup"> Signup </a>
          </ul>
        </nav>
      </header>

    );
  }

  export default Header;
